import React from "react";
import Artist from "../artist/artist";

import "./content.scss";

class Content extends React.Component {
  state = {
    currentPage: "home",
    searchText: "",
    data: [
      {
        singer: "hadi",
        track: "first 1",
      },
      {
        singer: "hado",
        track: "first 2",
      },
    ],
  };
  render() {
    return (
      <div className="content">
        <Artist />
      </div>
    );
  }
}

export default Content;
